  render() {
    return (
      <div>
        <br />
        <br />
        <br />
        <br />
        <div className={Styles.userDetails}>
          <h3 className="text-center"> View Employee Details</h3>
          <br></br>
          <div className="card-body text-center">
            <div className="text-center">
              <img
                className={Styles.profileImg}
                src={URL.createObjectURL({binaryData})}
              ></img>
            </div>
            <br></br>
            <div className="row">
              <label>
                {" "}
                First Name: <b>{this.state.employee.first_name}</b>
              </label>
            </div>
            <br></br>
            <div className="row">
              <label>
                {" "}
                Last Name: <b>{this.state.employee.last_name}</b>
              </label>
            </div>
            <br></br>
            <div className="row">
              <label>
                {" "}
                Email ID: <b>{this.state.employee.email_id}</b>
              </label>
            </div>
            <br></br>
            <div className="row">
              <label>
                {" "}
                Password: <b>{this.state.employee.password}</b>
              </label>
            </div>
            <br></br>
          </div>
        </div>
      </div>
    );
  }
}

export default ViewEmployeeComponent;
